    data: |
      SELECT DISTINCT + CAST ( + col2 AS INTEGER ) + + col1 AS col0 FROM tab0 (FORMAT parquet) WHERE NOT - ( + CAST ( + 15 AS REAL ) ) IS NOT NULL;
  - name: tab0

outputs:
  - name: q6416.out
    data: |
